import React, { Component } from 'react';

class Resultado extends Component {

    mostrarVideos = () => {
        const videos = this.props.videos;

        if(videos.length === 0) return null;
        console.log(videos.length);
    }

    render() { 
        return (
            <React.Fragment>
                {this.mostrarVideos()}
            </React.Fragment>
        );
    }
}
 
export default Resultado;
